import React from "react";
import styles from "./FieldSet.module.scss";
import { TextField } from "@material-ui/core";
const FieldSet = () => {
  return (
    <div className={styles.form}>
      <div className={styles.row}>
        <TextField className={styles.text} id="outlined-basic" variant="outlined" label="Tiêu Đề" />
      </div>
      <div className={styles.row}>
        <TextField label='Nội Dung 1' multiline rows={'100%'} variant='outlined' />
      </div>
      <div className={styles.row}>
          <TextField label='Nội Dung 2' multiline variant='outlined'></TextField>
      </div>
      <div className={styles.row}>
        <TextField label='Nội Dung 3' multiline variant='outlined'></TextField>
      </div>
    </div>
  );
};

export default FieldSet;
